!function(){var e,t=document.querySelector(".getLinks"),n=document.querySelector(".urlInput");e=(()=>{var e=document.querySelector("#output");e.innerHTML="Fetching the video informations...",fetch(`https://ripsave.com/download?video=${n.value}`).then(e=>e.text()).then(t=>{e.innerHTML=t,document.querySelectorAll(".download .table a").forEach(e=>{e.classList.contains("btn-success")||e.classList.add("btn-success")})}).catch(e=>console.log(`Error is: ${e.name} and Error message is: ${e.message}`))}),t.onclick=e}();
